USE `fsraiDatabase`;
INSERT INTO `fsraiDatabase`.`USER` (`ID`, `CREATED_AT`, `UPDATED_AT`, `FIRSTNAME`, `LASTNAME`, `DATE_OF_BIRTH`, `DESCRIPTION`, `PICTURE`, `EMAIL`, `PASSWORD`, `ROLE_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Danny', 'Steinbrecher', '1989-12-24', 'In der Fachschaft seit 2018!<br> <br>Ich heiße Danny, bin 30 Jahre alt und studiere seit 2018 Angewandte Informatik an der FH-Erfurt. Beim FSR wirke ich seit dem 1. Semester mit und bin seit dem 3. Semester der Sprecher des FSR. Neben den Aufgaben in dem FSR Angagiere ich mich auch in einem Mentorenprogramm hier an der FH.<br> <br> Ich selber habe schon eine Ausbildung zum Werkzeugmechaniker abgeschlossen und eine Weiterbildung zum staatlich geprüften Techniker absolviert. Somit konnte ich vor dem Studium schon Erfahrungen als CAD-Konstrukteur und Projektleiter sammeln.<br> <br>Meine Hobbys sind Computer (wer hätte es gedacht), Musik und Mountainbike!', 'profil1.jpg', 'danny.steinbrecher@fh-erfurt.de', '$2y$13$DOnSoL6TvqCybutTEHUjMuXopthlrIxUYe2VL04Zpz59qk.Mh8uKy', 1);
INSERT INTO `fsraiDatabase`.`USER` (`ID`, `CREATED_AT`, `UPDATED_AT`, `FIRSTNAME`, `LASTNAME`, `DATE_OF_BIRTH`, `DESCRIPTION`, `PICTURE`, `EMAIL`, `PASSWORD`, `ROLE_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Niclas', 'Jarowsky', '1999-05-19', '', 'profil2.jpg', 'niclas.jarowsky@fh-erfurt.de', '$2y$13$DOnSoL6TvqCybutTEHUjMuXopthlrIxUYe2VL04Zpz59qk.Mh8uKy', 1);
INSERT INTO `fsraiDatabase`.`USER` (`ID`, `CREATED_AT`, `UPDATED_AT`, `FIRSTNAME`, `LASTNAME`, `DATE_OF_BIRTH`, `DESCRIPTION`, `PICTURE`, `EMAIL`, `PASSWORD`, `ROLE_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Anja', 'Ebersbacher', '1998-12-16', 'In der Fachschaft seit 2018!<br> <br>Ich heiße Anja, bin 21 Jahre alt und studiere seit dem Sommersemester 2018 Angewandte Informatik. Ich bin in Erfurt geboren, aufgewachsen und wohne immernoch hier. <br> <br>Seit meinem ersten Semester bin ich in der Fachschaft aktiv.<br> Dort war ich 2018 für die Erstsemestereinführungen mitverantwortlich und bin seit 2019 als stellvertretende Specherin im FSR tätig.<br> Zu mir privat: ich spiele Klavier und Gitarre und kellnere neben dem Studium. Meine Lieblingsfarbe ist rosa, wenn ich ein Tier wäre, dann eine Katze und wenn ich in meinem Leben nur noch ein Gericht essen dürfte, wäre das Sushi.', 'profil3.jpg', 'anja.ebersbacher@fh-erfurt.de', '$2y$13$DOnSoL6TvqCybutTEHUjMuXopthlrIxUYe2VL04Zpz59qk.Mh8uKy', 2);
INSERT INTO `fsraiDatabase`.`USER` (`ID`, `CREATED_AT`, `UPDATED_AT`, `FIRSTNAME`, `LASTNAME`, `DATE_OF_BIRTH`, `DESCRIPTION`, `PICTURE`, `EMAIL`, `PASSWORD`, `ROLE_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Phillipp', 'Faber', '1997-04-17', 'In der Fachschaft seit 2017! <br> <br>Hey, ich bin Philipp, 22 Jahre jung und komme aus Nordhausen. Mittlerweile studiere ich im fünften Semester Angewandte Informatik. In der Fachschaft bin ich erst seit dem zweiten Semester, weil ich vorher zunächst einen Fuß in das studieren setzen wollte.<br> Darüber hinaus bin ich stolzer Coach der Fußballmannschaft „Juventus Ritalin“, welche jeden Dienstag für den alljährlichen Soccer Cup der Fakultät trainiert. Auch in diesem  <br> <br>Wenn ich mal nicht in am Campus bin, sitze ich Daheim am Schreibtisch (hust hust), im Fitnessstudio odertreffe mich mit Freunden. Außerdem gehe ich gern ins Kabarett. Falls ihr mich sucht, schaut nach der Lücke in der Menschenmasse. Da stehe ich!', 'profil4.jpg', 'philipp.faber@fh-erfurt.de', '$2y$13$DOnSoL6TvqCybutTEHUjMuXopthlrIxUYe2VL04Zpz59qk.Mh8uKy', 2);
INSERT INTO `fsraiDatabase`.`USER` (`ID`, `CREATED_AT`, `UPDATED_AT`, `FIRSTNAME`, `LASTNAME`, `DATE_OF_BIRTH`, `DESCRIPTION`, `PICTURE`, `EMAIL`, `PASSWORD`, `ROLE_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Admin', 'FSRAI', '1986-04-01', 'Ich bin der Standart Administrator, damit man hier auch ein wenig auf der Webseite herumprobieren kann.', 'profil5.jpg', 'admin@fh.de', '$2y$13$bJdi31tD.4E4sfvK9nCCS.SaPXEHb0QrO2aBGDZ/zwgj.031CUTMy', 1);
INSERT INTO `fsraiDatabase`.`USER` (`ID`, `CREATED_AT`, `UPDATED_AT`, `FIRSTNAME`, `LASTNAME`, `DATE_OF_BIRTH`, `DESCRIPTION`, `PICTURE`, `EMAIL`, `PASSWORD`, `ROLE_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Mitglied', 'FSRAI', '1993-07-12', 'Ich bin das Standart Mitglied, damit man hier auch ein wenig auf der Webseite herumprobieren kann.', 'profil6.jpg', 'mitglied@fh.de', '$2y$13$bJdi31tD.4E4sfvK9nCCS.SaPXEHb0QrO2aBGDZ/zwgj.031CUTMy', 2);
INSERT INTO `fsraiDatabase`.`USER` (`ID`, `CREATED_AT`, `UPDATED_AT`, `FIRSTNAME`, `LASTNAME`, `DATE_OF_BIRTH`, `DESCRIPTION`, `PICTURE`, `EMAIL`, `PASSWORD`, `ROLE_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Nutzer', 'FSRAI', '1996-08-27', 'Ich bin der Standart Nutzer, damit man hier auch ein wenig auf der Webseite herumprobieren kann.', 'profil7.jpg', 'nutzer@fh.de', '$2y$13$bJdi31tD.4E4sfvK9nCCS.SaPXEHb0QrO2aBGDZ/zwgj.031CUTMy', 3);
INSERT INTO `fsraiDatabase`.`USER` (`ID`, `CREATED_AT`, `UPDATED_AT`, `FIRSTNAME`, `LASTNAME`, `DATE_OF_BIRTH`, `DESCRIPTION`, `PICTURE`, `EMAIL`, `PASSWORD`, `ROLE_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Marie ', 'Mueller', '1991-01-28', 'In der Fachschaft seit 2018! <br> <br>Hi ihr Lieben, ich heiße Marie, bin 29 Jahre alt und im dritten Semester. Ich bin gebürtige Leipzigern. Ich bin seit ich an der FH studiere in der Fachschaft und dort vor allem im Sinne des Fachschaftsdiensts tätig. Außerhalb der FH findet man mich einmal wöchentlich beim Training des Reitercorps der Karnevalsgesellschaft, meiner großen Leidenschaft. Ansonsten gibt es über mich nur noch zu sagen, dass ich für jeden Quatsch zu haben bin!', 'profil8.jpg', 'marie.mueller@fh-erfurt.de', '$2y$13$DOnSoL6TvqCybutTEHUjMuXopthlrIxUYe2VL04Zpz59qk.Mh8uKy', 2);
INSERT INTO `fsraiDatabase`.`USER` (`ID`, `CREATED_AT`, `UPDATED_AT`, `FIRSTNAME`, `LASTNAME`, `DATE_OF_BIRTH`, `DESCRIPTION`, `PICTURE`, `EMAIL`, `PASSWORD`, `ROLE_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Lukas ', 'Meister', '1996-01-10', 'In der Fachschaft seit 2019! <br> <br>Fachschaftsdienst<br> Ich bin Lukas, bin 24 Jahre alt und studiere seit dem WiSe 19/20 an der FH. Ich bin also noch ein frisches Mitglied im Fachschaftsrat.', 'profil9.jpg', 'lukas.meister@fh-erfurt.de', '$2y$13$DOnSoL6TvqCybutTEHUjMuXopthlrIxUYe2VL04Zpz59qk.Mh8uKy', 2);
INSERT INTO `fsraiDatabase`.`USER` (`ID`, `CREATED_AT`, `UPDATED_AT`, `FIRSTNAME`, `LASTNAME`, `DATE_OF_BIRTH`, `DESCRIPTION`, `PICTURE`, `EMAIL`, `PASSWORD`, `ROLE_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Marcel', 'Kaiser', '1991-10-09', 'In der Fachschaft seit 2016!<br><br>Mein Name ist Marcel, ich bin 28 Jahre alt und bin im 7. Semester. Ich komme ursprünglich aus dem entfernten Hamburg. In der Fachschaft bin ich seit Beginn meines Studiums aktiv. Seit 2015 bin ich auch als Mitglied der Fakultätsvertretung gewählt. Damit ich mich auch überregional für die Optimierung unserer Fachschaft und ihrer Angebote einsetzen kann, bin auch in der Landesfachschaft und auf den Treffen der Bundesfachschaft aktiv.<br><br>In meiner Freizeit bin ich auch in der Studienkommission hier an der FH-Erfurt tätig!', 'profil10.jpg', 'marcel.kaiser@fh-erfurt.de', '$2y$13$DOnSoL6TvqCybutTEHUjMuXopthlrIxUYe2VL04Zpz59qk.Mh8uKy', 2);
