INSERT INTO `fsraiDatabase`.`EVENT` (`ID`, `CREATED_AT`, `UPDATED_AT`, `NAME`, `DATE`, `DESCRIPTION`, `PICTURE`, `LOCATION_ID`) VALUES (DEFAULT, DEFAULT, NULL, 'Sommerabschlussgrillen', '2020-02-28', 'Wir wollen zum Ende des Semesters und der Prüfungsphase zusammen mit euch auf dem Campus das Semester ausklingen und die Semesterferien kommen lassen. Wir werden ab 14:00 Uhr, in der Mitte des Campus, den Grill anschmeißen und für euch fleißig die Würste auf den Grill hauen. Natürlich wird es auch Steaks, sowie Grillkäse geben. Desweiteren gibt es jede Menge Getränke, zum Beispiel Bier, Radler und Softdrinks. Wir würden uns freuen, wenn Ihr mit uns zusammen noch einen schönen Nachmittag verbringt! Und bringt gerne Freunde mit!', 'event-26-02-2020-20-54-57.jpg', 4);

